import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import Paises from './components/Paises';
import Espanya from './components/Espanya';
import Francia from './components/Francia';
import Portugal from './components/Portugal';
import Alemania from './components/Alemania';

const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();
export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Paises">
        <Drawer.Screen name="Paises" component={Paises} />
        <Drawer.Screen name="Espanya" component={Espanya} />
        <Drawer.Screen name="Francia" component={Francia} />
        <Drawer.Screen name="Portugal" component={Portugal} />
        <Drawer.Screen name="Alemania" component={Alemania} />

      </Drawer.Navigator>
      <Stack.Navigator>
        <Stack.Group>
          <Stack.Screen name="home" component={Home} />
        </Stack.Group> <Stack.Group screenOptions={{ presentation: 'modal' }}>
          <Stack.Screen name="PantallaModal" component={PantallaModal} />
        </Stack.Group>
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
